import './header.css';

export default function Header() {
    return (
        <div className='header'>
            <div className='headerTitles'>
                <span className='headerTitleSm'>
                    React & Node
                </span>
                <span className='headerTitleLg'>
                    Blog
                </span>
            </div>
            <img
                alt='header-pic'
                className='headerImg'
                src='https://images.pexels.com/photos/17666/pexels-photo.jpg?auto=compress&cs=tinysrgb&h=750&w=1260'
            />
        </div>
    );
}
